                    Y1Y1_male * Z1Z1_male * X2Y2_male * W2W2_male, # male   60 m19 Y1Y1 Z1Z1 X2Y2 W2W2 
                    Y1Y1_male * Z1Z1_male * Y2Y2_male * Z2Z2_male, # male   61 m20 Y1Y1 Z1Z1 Y2Y2 Z2Z2 
