                    Y1Y1_male * Z1W1_male * Y2Y2_male * Z2Z2_male, # male   70 m26 Y1Y1 Z1W1 Y2Y2 Z2Z2 
                    Y1Y1_male * Z1W1_male * Y2Y2_male * Z2W2_male, # male   71 m27 Y1Y1 Z1W1 Y2Y2 Z2W2 
                    Y1Y1_male * Z1W1_male * Y2Y2_male * W2W2_male, # male   72 m28 Y1Y1 Z1W1 Y2Y2 W2W2 
                    Y1Y1_male * W1W1_male * X2Y2_male * Z2Z2_male, # male   76 m29 Y1Y1 W1W1 X2Y2 Z2Z2 
